const initialState = {
  newValue: "",
};

export const loginReducer = (state = initialState, action) => {
  switch (action.type) {
    case "LOGIN_ACTION":
      return {
        ...state,
        newValue: action.newValue,
      };
    default:
      return state;
  }
};
